import { db } from '../../firebase';
const Home = () => {
  const [count, setCount] = useState(0);

  useEffect(() => {
    db.collection('rooms')
      .doc('giBj09ZbcvrbYaCdt6xp')
      .onSnapshot(function(doc) {
        console.log(doc);
      });
    document.title = `You clicked ${count} times`;
  });
  return <div>Home</div>;
};

export default Home;
